import React from 'react';
import './App.css';
import Header from './component/Header';
import AppFooter from './component/AppFooter';
import { Container } from 'react-materialize';
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Header />

      <Router>
        <Route exact path="/" />
      </Router>
      <AppFooter />
    </div>
  );
}

export default App;
